import React from 'react';
import Grid from '@material-ui/core/Grid';
import insta_image from '../../images/9364675fb26a.svg';
import insta_logo from '../../images/9364675fb26a.svg';

function LoginPage() {
  return (
    <div>
        <Grid container>
            <Grid item xs={3}>aaa</Grid>
            <Grid item xs={6}>
                <div className={"loginPage_main"}>
                    <div>
                        <img src={insta_image} width={"454px"} alt="인스타그램사진" />
                    </div>
                    <div>
                        <div className={"loginPage_logo"}>
                            <img src={insta_logo} alt=""/>
                        </div>
                    </div>
                </div>
            </Grid>
            <Grid item xs={3}>ccc</Grid>
        </Grid>
        Hello World!
    </div>
  );
};

export default LoginPage;
